parameters.message:
=Hi Cynthia - 

You have {{ $('Aggregate').item.json.data.length }} orders from the past 7 days:

{{
$('Aggregate').item.json.data.map((order, index) => {
  let items;
  try {
    items = JSON.parse(order.items);
  } catch (e) {
    items = [order.items];
  }

  const itemLines = items.map(i => `  - ${i}`).join('\n');

  return [
    `Order ${index + 1}:`,
    `Name: ${order.name}`,
    `Company: ${order.company}`,
    `Date: ${order.date}`,
    'Items:',
    itemLines,
    'Shipping:',
    `  ${order.shipping}`
  ].join('\n');
}).join('\n\n')
}}

Total Amount Paid: ${{
$('Aggregate').item.json.data
  .map(order => Number(order.amount) || 0)
  .reduce((sum, value) => sum + value, 0)
}}

Thank you,
Edward

